{'pk': 18072745507102254, 'user_id': 5434444079, 'text': '👉🏻¿Cómo se puede explicar la fascinación que muchos sintieron con el macrismo? ¿Cuándo te diste cuenta de que eras peronista? ¿Te agarraste a piñas por política? ¿Hay que mantener la relación con el Fondo Monetario? ¿Cuánto de la política económica de Macri fue planeado y cuánto fue un error? ¿Cómo se aborda la cuestión de la corrupción? ¿No hizo mal el kirchnerismo en pelearse con el campo? ¿Qué nivel de reforma política requieren tus ideas económicas? ¿A quién le sirve la grieta? ¿Qué hay que hacer para que la Argentina sea alguna vez un “país normal”? ¿Sos feminista?

Lejos del análisis puramente económico en el que muchas veces se lo quiere encasillar, en este libro Axel Kicillof se presta, cómodo y reflexivo, al juego de exponer y argumentar sus ideas políticas y a mirar el país de manera crítica pero también propositiva. Lo hace en diálogo con destacados y destacadas periodistas, interlocutores incisivos y nada complacientes, y el resultado son conversaciones apasionantes y reveladoras.

En estas páginas, Kicillof describe el complejo arte de seducir a los que piensan distinto y “saltar la grieta” en un diálogo agudo y desopilante con Pedro Saborido; analiza el escenario político reciente y el que viene en un intercambio con momentos tanto de coincidencia como de distancia con Carlos Pagni; profundiza en las variables económicas en un diálogo punzante con Alejandro Bercovich; retoma la cuestión de la batalla cultural, analiza el movimiento feminista y la posibilidad de un país sin grietas frente a Noelia Barral Grigera e Ingrid Beck, y muestra su costado menos conocido y su experiencia más personal de la actividad política a través de las lúcidas preguntas de Ángela Lerena. “Creo que el famoso intento de ‘cerrar la grieta’ no consiste en que todos estemos de acuerdo en todo –escribe Kicillof en la presentación de este libro–. Es algo mucho más plausible: reconocer las distintas posiciones sin marketing, sin trolls, sin mentiras ni agresiones. Lo contrario de la grieta es, ni más ni menos, que la política.”
