{'pk': 18044714764174634, 'user_id': 5434444079, 'text': '🎬 Llegó a nuestra librería un libro de colección «Bergman 100 / Ingmar Bergman en Argentina». Finamente diseñado, ilustrado e impreso, en tirada limitada, incluye artículos de críticos e historiadores del cine argentino actual, analiza la repercusión del cine de Bergman en la Argentina a través del tiempo: Alejandra Portela, Paula Vázquez Prieto, Eduardo Russo, Hernán Gaffet, Fernando G. Varea, Adrián Muoyo, Diedgo Schulman•
•
Notas, avisos, críticas, programas de mano de época más trabajos especialmente producidos de artistas gráficos de Augusto Costhanzo, El Niño Rodríguez, Santi Pozzi, el recordado Eduardo Maicas y Pipi Spósito•
•
Este libro es presentado junto a la muestra “Bergman en Argentina” curada por Raúl Manrupe con material inédito. Se exhibe en el Conti durante todo el mes de agosto.
