{'pk': 18016578106216664, 'user_id': 5434444079, 'text': '👉🏻Presentamos en nuestra librería el libro “Memorias de "la décima" división de primer año, Colegio Nacional de Buenos Aires (1971- 1976)
Una microhistoria compartida” de María Inés Palleiro junto a Vera Jarach, Lucila Paglai, Viviana Patricia Keegan, Leda Silvia Maidana, Gaby Meik y Nora Olga Malatesta•

Una reunión, destinada a conmemorar los cuarenta años del egreso de los alumnos de la promioción 1976 del Colegio Nacional Buenos Aires, dio lugar a esta serie de testimonios: "Somos la promoción que entró con Lanusse, cursó con Cámpora y Perón y egresó con Videla". En estas voces vivas están las de aquellos que no lograron vivir para contar, pero que cuentan a través de nosotros".', 'type': 1, 'created_at': 1563716607, 'created_at_utc': 1563716607, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 5434444079, 'username': 'libreriadelconti', 'full_name': 'Librería del Conti', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/27574564_1996343993709362_1717881915039547392_n.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=IH8HBHX7UgcAX-UknJm&_nc_tp=25&oh=38ed1a37162ec2085ee88b9587a10562&oe=5FD18F45', 'profile_pic_id': '1710372605452904090_5434444079', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 0, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2092928655411022802, 'has_translation': True, 'private_reply_status': 0}

{'pk': 17854935373435480, 'user_id': 5434444079, 'text': "🔻 Hace 63 años, el 9 de junio de 1956, los generales Tanco y Valle se sublevaron contra el gobierno de facto que había destituido a Perón en septiembre de 1955. El levantamiento fue reprimido brutal e ilegalmente. Hubo muchos muertos, de los cuales sólo siete cayeron en acción. En los basurales de José León Suárez, un grupo de civiles -algunos de ellos relacionados vagamente con la conspiración; el resto, ajeno por completo a ella- fueron masacrados antes incluso de que fuera dictada la ley marcial. Unos pocos lograron escapar de la muerte, a duras penas. •

Rodolfo Walsh supo que un fusilado había sobrevivido.  Y ese fue el puntapié inicial para la investigación de los hechos que publicó en forma de notas en el diario 'Mayoría' y, poco después como libro en Operación Masacre. Walsh logró reconstruir los hechos y averiguar los detalles más importantes. Encontró a los fusilados vivos y les dio voz. •

Publicado por @edicionesdelaflor , Operación Masacre fue una de las primeras novelas de 'no ficción' escritas en castellano, inaugurando el Nuevo Periodismo en la aplicación de procedimientos propios del género novela al relato de hechos verdaderos. Operación Masacre fue, también, el inicio de su militancia peronista, aquella que lo llevará a pasar de la reflexión a las armas y a escribir la obra que lo hizo conocido fuera del país: la Carta abierta de un escritor a la junta militar.", 'type': 1, 'created_at': 1560088371, 'created_at_utc': 1560088371, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 5434444079, 'username': 'libreriadelconti', 'full_name': 'Librería del Conti', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/27574564_1996343993709362_1717881915039547392_n.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=IH8HBHX7UgcAX-UknJm&_nc_tp=25&oh=38ed1a37162ec2085ee88b9587a10562&oe=5FD18F45', 'profile_pic_id': '1710372605452904090_5434444079', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 0, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2062484701758772300, 'has_translation': True, 'private_reply_status': 0}

{'pk': 18000535597217326, 'user_id': 5434444079, 'text': '🛶 En el día en que cumpliría 94 años, recordamos a Haroldo Conti con «Sudeste», su primera novela. En sus páginas, el paisaje del Delta y el río Paraná es casi un personaje más, especie de dios arbitrario que rige los destinos de la gente que puebla sus orillas. Gente solitaria, taciturna, que vive de la pesca y de la recolección del junco, y come galleta con mate o algún pescado con gusto a barro. Entre ellos está el Boga, deambulando río arriba en su pequeño bote, cada día más ensimismado y desprendido de lo que le rodea.
.

